import React, { useContext, useEffect, useState } from "react";
import { AuthContext } from "../context/AuthContext";
import { fetchProtectedData, getUsers,  updateUser, deleteUser } from "../services/api";

const DashboardAdmin = () => {
  const { logout, token } = useContext(AuthContext);

  const [protectedData, setProtectedData] = useState(null);
  const [users, setUsers] = useState([]);
  const [error, setError] = useState("");
  const [editMode, setEditMode] = useState(null);
  const [formData, setFormData] = useState({});

  useEffect(() => {
    const loadData = async () => {
      try {
        const data = await fetchProtectedData(token);
        setProtectedData(data);

        const usersList = await getUsers(token);
        setUsers(usersList);
      } catch (err) {
        setError("Error al cargar datos o usuarios: " + err.message);
      }
    };

    if (token) loadData();
  }, [token]);

  const handleEdit = (user) => {
    setEditMode(user.usuario);
    setFormData({
      rango: user._userInfo?.rango || "",
      creditos: user._userInfo?.creditos || 0,
    });
  };

  const handleCancel = () => {
    setEditMode(null);
    setFormData({});
  };

  const handleSave = async (usuario) => {
    try {
      const newData = {
        _userInfo: {
          rango: formData.rango,
          creditos: Number(formData.creditos),
        },
      };

      const updatedUser = await updateUser(usuario, newData, token);

      setUsers((prevUsers) =>
        prevUsers.map((u) => (u.usuario === usuario ? updatedUser.user : u))
      );

      setEditMode(null);
      setFormData({});
    } catch (err) {
      setError("Error actualizando usuario: " + err.message);
    }
  };

  const handleDelete = async (usuario) => {
    try {
      await deleteUser(usuario, token);
      setUsers((prevUsers) => prevUsers.filter((u) => u.usuario !== usuario));
    } catch (err) {
      setError("Error eliminando usuario: " + err.message);
    }
  };

  if (error) return <p>{error}</p>;
  if (!protectedData || users.length === 0) return <p>Cargando...</p>;

  return (
    <div className="dashboard-container">
      <h1>Dashboard Admin</h1>

      <section>
        <h2>Usuarios</h2>
        <ul>
          {users.map((user) => (
            <li key={user.usuario || user.id}>
              {editMode === user.usuario ? (
                <>
                  <input
                    type="text"
                    value={formData.rango}
                    onChange={(e) =>
                      setFormData({ ...formData, rango: e.target.value })
                    }
                    placeholder="Rango"
                  />
                  <input
                    type="number"
                    value={formData.creditos}
                    onChange={(e) =>
                      setFormData({ ...formData, creditos: e.target.value })
                    }
                    placeholder="Créditos"
                  />
                  <button onClick={() => handleSave(user.usuario)}>Guardar</button>
                  <button onClick={handleCancel}>Cancelar</button>
                </>
              ) : (
                <>
                  {user.usuario} - {user._userInfo?.rango || "Sin rango"} -{" "}
                  {user._userInfo?.creditos ?? 0} créditos
                  <button onClick={() => handleEdit(user)}>Editar</button>
                  <button onClick={() => handleDelete(user.usuario)}>Eliminar</button>
                </>
              )}
            </li>
          ))}
        </ul>
      </section>

      <button onClick={logout}>Cerrar sesión</button>
    </div>
  );
};

export default DashboardAdmin;
